INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('88b3e5cf-d041-4638-81d0-609becac9810', '2023-05-12 10:40:33.426547', '2023-05-12 10:40:33.426547', NULL, NULL, NULL, NULL, 'Giường Spencer', 'Chiếc giường Spencer của Minotti, tinh xảo và uốn lượn, có những đường nét mềm mại kết hợp tính thẩm mỹ và công thái học, những nguyên tắc làm nền tảng cho ý tưởng dẫn đến hệ thống ghế ngồi cùng tên.', 'https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1600/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_2.jpg', '["https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1600/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_2.jpg"]', '12999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Jazz Age Marble', 'Luminous light', 'A bottle of wine with wine glasses', 'The kitchen table', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('63006fcd-2642-4dc4-807b-10d5a2c9e1b0', '2023-05-12 10:41:49.277415', '2023-05-12 10:41:49.277415', NULL, NULL, NULL, NULL, 'GIƯỜNG MINELLI', 'Giường Minelli hoàn hảo cho không gian phòng ngủ vừa trang nhã vừa tinh tế. Thân giường này, hiển thị các đường hữu cơ đẹp mắt, được làm bằng gỗ óc chó và sau đó được bao phủ một cách chuyên nghiệp bằng nhung ngoại quan. Chỉ còn lại các mặt bằng gỗ lộ ra ngoài, cho thấy sự trang nghiêm thực sự của chiếc giường này. Không còn nghi ngờ gì nữa, một thiết kế thực sự truyền cảm hứng cho những người yêu thích phong cách cổ điển, những người khao khát thiết kế xa hoa nhưng rõ ràng.', 'https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_2048/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_5-2048x1434.jpg', '["https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_2048/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_5-2048x1434.jpg"]', '10999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Elite Marble', 'Clean light', 'A display of fresh vegetables and fruits arranged artistically', 'The retail counter', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('23c0052c-e3b3-444c-854a-959b50545985', '2023-05-12 10:56:54.668358', '2023-05-12 10:56:54.668358', NULL, NULL, NULL, NULL, 'GIƯỜNG KELLY', 'Giường Kelly của Fendi Casa nổi bật với thiết kế hiện đại được đặc trưng bởi tính linh hoạt đầy phong cách nhờ các phân đoạn mặt bên bằng kim loại, có sẵn các phiên bản màu xám kim loại súng, màu Đồng Bóng hoặc lớp hoàn thiện Palladium. Biểu trưng F bằng kim loại phối hợp hình tròn nhỏ là biểu trưng của Fendi.', 'https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1536/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_6.jpg', '["https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1536/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_6.jpg"]', '8999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Atomic Marble', 'Ethereal light', 'A bowl of nuts and dried fruits', 'The sink', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('bbdc97cd-856b-4685-8c21-a7f2eed8c526', '2023-05-12 10:57:57.105334', '2023-05-12 10:57:57.105334', NULL, NULL, NULL, NULL, 'GIƯỜNG CHÂTEAU', 'Giường Château được lấy cảm hứng từ những bức tường của lâu đài Pháp, tấm ván đầu giường tráng lệ này chiếm mọi phòng ngủ và biến nó thành căn phòng độc nhất. Được làm bằng da và các thanh đồng thau mạ vàng, đó là một đầu giường hiện đại sẽ tạo nên một tuyên bố ấn tượng trong bất kỳ phòng ngủ nào – hiện đại hay trang nghiêm.', 'https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1200/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_7.jpg', '["https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1200/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_7.jpg"]', '15999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Contemporary Marble', 'Illuminated light', 'A set of coffee cups and a coffee maker', 'The refrigerator', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('34f8abdb-fdc7-40f4-b509-e15b7e40bce7', '2023-05-12 10:59:42.804644', '2023-05-12 10:59:42.804644', NULL, NULL, NULL, NULL, 'Giường Reeves', 'Đầu giường bao bọc được tăng cường với các chi tiết mang tính xây dựng thể hiện một ngôn ngữ thẩm mỹ tươi tốt với nội dung được cắt may tinh xảo và thấm nhuần các hình dạng cổ điển với một góc cạnh hiện đại. Giường bao gồm một 17 cm. Chân đế H. có lò xo túi, cùng với nệm “Comfort H. 25”, mang đến chất lượng giấc ngủ vượt trội. Đường may tinh xảo thể hiện rõ ở các khớp 45° của ván để chân và ở đường khâu trang trí đầu giường và ván chân giường.', 'https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1600/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_12.jpg', '["https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_1600/https://www.essentialhome.eu/inspirations/wp-content/uploads/2021/01/The-20-Luxury-Beds-You-Need-In-Your-Home-Now_12.jpg"]', '14999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Chic Marble', 'Ominous', 'A display of fresh vegetables and fruits arranged artistically', 'The sink', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('6fb0c858-1adf-4cec-b95c-4fa52955e2d3', '2023-05-12 11:20:51.693416', '2023-05-12 11:20:51.693416', NULL, NULL, NULL, NULL, 'High Backed Reading Chair', 'Chiếc ghế trong phòng ngủ này có lưng cao, hỗ trợ thắt lưng tuyệt vời để ngồi lâu hơn. Nó được đặt gần cửa sổ, báo hiệu khả năng sử dụng nó vào ban ngày để đọc. Nó nhỏ hơn và nhẹ hơn, vì vậy việc tìm một chỗ cho chiếc ghế đặc biệt này trong phòng ngủ nhỏ hơn sẽ tương đối dễ dàng.', 'https://homedecorbliss.com/wp-content/uploads/2021/03/Bedroom-interior-with-large-bed-modern-nightstand-and-wall-lamp-armchair-many-books-around-plant-blank-wall.-Copy-space-template-1024x576.jpg', '["https://homedecorbliss.com/wp-content/uploads/2021/03/Bedroom-interior-with-large-bed-modern-nightstand-and-wall-lamp-armchair-many-books-around-plant-blank-wall.-Copy-space-template-1024x576.jpg"]', '4999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Raw Marble', 'Daylight', 'A bowl of fresh citrus fruits', 'The breakfast nook', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('0c75f70e-e636-4fa1-afd4-541b0dd2761a', '2023-05-12 11:23:32.286164', '2023-05-12 11:23:32.286164', NULL, NULL, NULL, NULL, 'Bàn trang điểm có gương', 'Bàn trang điểm có gương là một món đồ nội thất tiện dụng và cực kỳ hữu ích trong bất kỳ phòng ngủ nào. Đây là một nơi tuyệt vời để lưu trữ mỹ phẩm, lược, đồ trang sức và tất cả những thứ quan trọng khác của phụ nữ. Bàn trang điểm là khu vực cá nhân, nơi phụ nữ cất giữ vũ khí bí mật của họ, nơi chúng ta dành khá nhiều thời gian để chuẩn bị cho ngày mới, vì vậy điều rất quan trọng là món đồ nội thất này không chỉ đẹp mà còn phải thoải mái và tiện dụng .', 'https://deavita.net/wp-content/uploads/2015/10/modern-white-vanity-table-with-mirror-bedroom-furniture-ideas-functinal-design.jpg', '["https://deavita.net/wp-content/uploads/2015/10/modern-white-vanity-table-with-mirror-bedroom-furniture-ideas-functinal-design.jpg"]', '7999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Futuristic Marble', 'Macabre', 'A cutting board with fresh herbs and spices', 'The refrigerator', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('4fa9dc15-2698-4ea3-8a9c-1f795c9bc9ac', '2023-05-12 11:26:50.579078', '2023-05-12 11:26:50.579078', NULL, NULL, NULL, NULL, 'Giấy dán tường hoa văn cổ điển cho nội thất phòng ngủ hiện đại của bạn', 'Giấy dán tường có hoa văn cổ điển với thiết kế phức tạp này trông thanh lịch và không làm cho căn phòng trở nên choáng ngợp. Nó kết hợp hoàn hảo với đồ nội thất hiện đại của phòng ngủ làm cho nó trở thành một lựa chọn hoàn hảo cho không gian này.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003313/wallpaper-design-for-bedroom-for-a-classical-patterned-wallpaper.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003313/wallpaper-design-for-bedroom-for-a-classical-patterned-wallpaper.jpg"]', '1999000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Arctic Marble', 'Golden light', 'A dish of olives or pickled vegetables', 'The pantry', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('8af84206-1e7b-4c0a-b615-728e3a83d80e', '2023-05-12 11:28:40.497627', '2023-05-12 11:28:40.497627', NULL, NULL, NULL, NULL, 'Giấy dán tường phòng ngủ có hoa văn hình học', 'Hình nền hoa văn hình học này là lựa chọn tốt nhất cho những ai bị ám ảnh bởi sự đối xứng. Bạn có thể chọn hình nền này nếu bạn muốn có một bức tường đặc trưng duy nhất trong phòng ngủ của mình. Còn tuyệt vời hơn nữa, bạn có thể sử dụng kết hợp bốn màu do mình chọn để làm nổi bật.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003316/wallpaper-for-bedroom-walls.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003316/wallpaper-for-bedroom-walls.jpg"]', '1299000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Legacy Marble', 'Brooding', 'A display of colorful spices and seasonings', 'The sink', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('ae0d56db-fb0c-42e0-a55d-0321329f5b81', '2023-05-12 11:30:46.40043', '2023-05-12 11:30:46.40043', NULL, NULL, NULL, NULL, 'Hình Nền Hoa Đen Trắng Cho Phòng Ngủ Của Bạn', 'Thiết kế hình nền hoa này kết hợp sự tinh tế của thiên nhiên với sự kết hợp giữa màu đen và trắng khiến phòng ngủ này trông sang trọng và thanh lịch cùng một lúc. Các tấm gỗ giống như gỗ mang lại sự ấm áp cho phòng ngủ trong khi những bức tường trắng giúp thu hút sự chú ý đến thiết kế giấy dán tường phòng ngủ hiện đại của bạn.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003319/wallpaper-designs-for-bedroom-indian.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003319/wallpaper-designs-for-bedroom-indian.jpg"]', '1099000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Digital Marble', 'Illuminated light', 'A cutting board with fresh herbs and spices', 'The side table', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('6cc1cccf-b5e6-4839-aeb6-f390e684938e', '2023-05-12 11:31:44.016387', '2023-05-12 11:31:44.016387', NULL, NULL, NULL, NULL, 'hình nền màu hoa', 'Tạo một tuyên bố táo bạo với hình nền màu này là sự pha trộn sáng tạo giữa các bản in hoa và hình xoắn ốc hình học. Nó chắc chắn sẽ khiến bạn say mê. Giấy dán tường màu hồng trên bức tường tạo điểm nhấn tạo nên sự tương phản nổi bật với những bức tường trắng và làm tăng vẻ đẹp cho không gian. Trong khi phòng học nhỏ với bàn học và tủ treo tường ở trên là hoàn hảo cho các cặp vợ chồng làm việc tại nhà.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003321/3d-wallpaper-for-bedroom-walls.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003321/3d-wallpaper-for-bedroom-walls.jpg"]', '1599000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Fusion Marble', 'Golden light', 'A bowl of freshly picked berries', 'The cashier counter', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('13c20997-de83-4cb9-b930-a61ab5819c68', '2023-05-12 11:32:52.328014', '2023-05-12 11:32:52.328014', NULL, NULL, NULL, NULL, 'Thiết kế giấy dán tường phòng ngủ cho vận động viên trong bạn', 'Giấy dán tường phòng ngủ hiện đại có nhiều hoa văn, màu sắc và chủ đề để phù hợp với tâm trạng, sở thích và lối sống của bạn. Nếu bạn có gen thể thao trong người, hình nền chịu ảnh hưởng của vận động viên này sẽ phản ánh chân thực khía cạnh đó của bạn. Cho dù bạn là một vận động viên bơi lội, leo núi đá, nhảy bungee, bạn có thể có được cơn sốt adrenaline đó cho một ngày tràn đầy năng lượng. Bạn cũng có thể thêm một số móc trên tường để treo dụng cụ thể thao của mình như trong hình này.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003323/wallpaper-for-bedroom-walls-designs.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003323/wallpaper-for-bedroom-walls-designs.jpg"]', '1459000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Antique Marble', 'Radiant light', 'A bowl of nuts and dried fruits', 'The cashier counter', 'Bedroom');
INSERT INTO "products" ("id", "created_at", "updated_at", "created_by", "updated_by", "deleted_at", "deleted_by", "name", "description", "thumbnail_url", "thumbnails", "price", "sale_price", "is_sale", "is_hot", "is_new", "is_best_seller", "additional_information", "style", "marble", "light_and_dark_style", "decorate_the_items", "kinds_of_large_objects", "room_type") VALUES ('8f51dd0b-32bd-4099-8942-47c924df18c0', '2023-05-12 11:34:01.917228', '2023-05-12 11:34:01.917228', NULL, NULL, NULL, NULL, 'Tranh Dán Tường Thiên Nhiên Đồng Quê Cho Tường Phòng Ngủ', 'Nếu bạn yêu thiên nhiên và mơ ước được thức dậy giữa rừng, bạn chắc chắn có thể lựa chọn hình nền tranh tường lấy cảm hứng từ vùng nông thôn này. Nó sẽ làm cho bạn cảm thấy hòa làm một với thiên nhiên.', 'https://media.designcafe.com/wp-content/uploads/2020/01/21003326/bedroom-wallpaper-design-for-home.jpg', '["https://media.designcafe.com/wp-content/uploads/2020/01/21003326/bedroom-wallpaper-design-for-home.jpg"]', '1459000', '0', 'f', 'f', 'f', 'f', '{}', 'Modern', 'Futuristic Marble', 'Shadowy', 'A cutting board with fresh herbs and spices', 'The work desk', 'Bedroom');
